import React from 'react'
import "./contact.css"

const Contact = () => {
  return (
    <section id='contact'>
     <h5>Get In Touch</h5>
     <h2>Contact Me</h2>
     <div className="container contact__container"></div>
    
    </section>
  )
}

export default Contact
